></span></span></span></span></p>\\n\\n<p style=\\\"text-align:center\\\"><span><span><span><span><span><span><span><span>                                   كَأَنَّـهـا لَـوْحَةٌ مِنْ عـالَـمٍ \\\"ثـاني\\\"</span></span></span></span></span></span></span></span></p>\\n\\n<p style=\\\"text-align:center\\\"><span><span><span><span><span><span><span><span>يُمَرِّغُ الفَجْرُ خَدَّيْهِ بِوَجْنَتِها</span></span></span></span></span></span></span></span></p>\\n\\n<p style=\\\"text-align:center\\\"><span><span><span><span><span><span><span><span>                                   وَيَفْتَحُ الصُّـبْـحُ فِيها قَلْبَهُ الحـانِي</span></span></span></span></span></span></span></span></p>\\n\\n<p style=\\\"text-align:center\\\"><span><span><span><span><span><span><span><span>وَلا يُفارِقُ آذارٌ خَمائِلَها</span></span></span></span></span></span></span></span></p>\\n\\n<p style=\\\"text-align:center\\\"><span><span><span><span><span><span><span><span>                                  وَيَسْـتَمِـرُّ عَلَـيْهـا زَهْـوُ نَيْســانِ</span></span></span></span></span></span></span></span></p>\\n\\n<p style=\\\"text-align:center\\\"><span><span><span><span><span><span><span><span>وَيُهْرَعُ الغَيْمُ مُشْتاقاً لِيَلْثِمَها</span></span></span></span></span></span></span></span></p>\\n\\n<p style=\\\"text-align:center\\\"><span><span><span><span><span><span><span><span>                                  بِجِيْدِها الغَضِّ أَوْ في طَرْفِها الرّاني</span></span></span></span></span></span></span></span></p>\\n\\n<p style=\\\"text-align:center\\\"><span><span><span><span><span><span><span><span>وَفي شَبابِيكِها الخَضْراءِ تَضْحَكُ لي</span></span></span></span></span></span></span></span></p>\\n\\n<p style=\\\"text-align:center\\\"><span><span><span><span><span><span><span><span>                                  دَوْمًا وُجـوهُ أَحِـبّـائِـي وَخُلّاني</span></span></span></span></span></span></span></span></p>\\n\\n<p style=\\\"text-align:center\\\"><span><span><span><span><span><span><span><span>أَحْنَتْ عَلَيْها يَدُ الإِبْداعِ تَرْسُمُها</span></span></span></span></span></span></span></span></p>\\n\\n<p style=\\\"text-align:center\\\"><span><span><span><span><span><span><span><span>                                  بِريشَةٍ ما انْضَوَتْ فـي كَفِّ فَنّانِ</span></span></span></span></span></span></span></span></p>\\n\\n<p style=\\\"text-align:center\\\"><span><span><span><span><span><span><span><span>أَهْلِي بَنَوْها.... أَقاموا صَرْحَ عِزَّتِها</span></span></span></span></span></span></span></span></p>\\n\\n<p style=\\\"text-align:center\\\"><span><span><span><span><span><span><span><span>                                  عَلى الإِباءِ... تَسامَتْ قُدْرَةُ الباني</span></span></span></span></span></span></span></span></p>\\n\\n<p style=\\\"text-align:center\\\"><span><span><span><span><span><span><span><span>تِلْكَ الأَماكِنُ تَحْيا في مُخَيِّلَتي</span></span></span></span></span></span></span></span></p>\\n\\n<p style=\\\"text-align:center\\\"><span><span><span><span><span><span><span><span>                                   دَوْمًا، وَتَسْرَحُ فِي عَقْلِي وَوِجْداني.</span></span></span></span></span></span></span></span></p>\\n\\n<p><span><span><span>                                                                                                                </span></span></span><br />\\n<span><span><span>                                          إبراهيم برّي / كتابُ القراءةِ - الصّفُّ الرّابعُ                                                         </span></span></span><span><span><span>                                                                                                          </span></span></span></p>\\n\\n<p> </p>\\n\\n<p style=\\\"text-align:right\\\"><strong>:شَرْحُ المفرداتِ</strong></p>\\n\\n<p style=\\\"text-align:right\\\">                           الحاني: العطوفُ -</p>\\n\\n<p style=\\\"text-align:right\\\">خمائِلها: شجرُها الكثيرُ الملتفُّ -</p>\\n\\n<p style=\\\"text-align:right\\\">يهرعُ: يسرعُ -</p>\\n\\n<p style=\\\"text-align:right\\\">يلثِمَها: يقبّلها -</p>\\n\\n<p style=\\\"text-align:right\\\">الغضُّ: الطّريُّ -</p>\\n\\n<p style=\\\"text-align:right\\\"> .خلّاني: أصدقائي -</p>\\n\\n<p style=\\\"text-align:right\\\"> .تسامَتْ: تعالَتْ -</p>\\n\\n<p style=\\\"text-align:right\\\"> .وجداني: نفسي -</p>\\n\\n<p style=\\\"text-align:right\\\"><strong>:خطواتُ توثيقِ نصٍّ</strong></p>\\n\\n<p style=\\\"text-align:right\\\">.<strong>أوّلًا:</strong> أُحدّدُ العنوانَ الموجودَ أعلى النّصِّ <strong>-</strong></p>\\n\\n<p style=\\\"text-align:right\\\">.<strong>ثانيًا:</strong> أحدّدُ اسمَ الكاتبِ الموجودِ أسفلَ النّصِّ <strong>-</strong></p>\\n\\n<p style=\\\"text-align:right\\\">.<strong>ثالثًا:</strong> أحدّدُ المصدرَ الّذي أُخِذَ منهُ النّصّ إنْ وُجدَ <strong>-</strong></p>\\n\\n<p style=\\\"text-align:right\\\">.<strong>رابعًا:</strong> أُحدّدُ تاريخَ النّشرِ إنْ وجدَ <strong>-</strong></p>\\n\\n<p style=\\\"text-align:right\\\"><span><span><span>    </span></span></span></p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"0cec5638-3b5a-41f2-91b1-6e81751253f9\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<p style=\\\"text-align:right\\\"><span style=\\\"font-size:1.375em\\\">  .٣- حدّدْ عنوانَ النّصِّ بالضّغطِ على الإجابةِ الصّحيحةِ</span></p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Text غير معنون\",\"authors\":[],\"changes\":[]},\"subContentId\":\"e9239d0e-6eff-4465-8b7d-8704d222ed60\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"imageHotspotQuestion\":{\"hotspotSettings\":{\"hotspot\":[{\"userSettings\":{\"correct\":true,\"feedbackText\":\"إجابةٌ صحيحةٌ\"},\"computedSettings\":{\"x\":67.33077292366778,\"y\":9.864364981504316,\"width\":30.24483917426788,\"height\":81.87422934648582,\"figure\":\"rectangle\"}}],\"showFeedbackAsPopup\":true,\"l "metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Text غير معنون\",\"authors\":[],\"changes\":[]},\"subContentId\":\"28b200af-2b98-4f0e-8010-cb5c8a407196\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"choices\":[{\"subContentId\":\"744d1b50-0037-4d00-b44a-dde98dca9ef7\",\"question\":\"<p style=\\\"text-align:right\\\">أ- عمّ يتحدّثُ الكاتبُ في البيتِ الأوّلِ منَ القصيدةِ؟</p>\\n\",\"answers\":[\"<p style=\\\"text-align: right;\\\">.يتحدّثُ الكاتبُ في البيتِ الأوّلِ منَ القصيدةِ عنْ قريَتِهِ</p>\\n\",\"<p style=\\\"text-align: right;\\\">.يتحدّثُ الكاتبُ في البيتِ الأوّلِ منَ القصيدةِ عنْ بيتِهِ في وسطِ المدينةِ</p>\\n\",\"<p style=\\\"text-align: right;\\\">.يتحدّثُ الكاتبُ في البيتِ الأوّلِ منَ القصيدةِ عنْ أولادهِ</p>\\n\"]},{\"subContentId\":\"0d3842ee-ab24-4cd4-820a-52c49cf83917\",\"question\":\"<p style=\\\"text-align:right\\\"> ب- بمَ شبّهَ الكاتبُ قريتَهُ؟</p>\\n\",\"answers\":[\"<p style=\\\"text-align: right;\\\">.شبّهَ الكاتبُ قريتَهُ بلوحةٍ منْ عالمٍ ثانٍ</p>\\n\",\"<p style=\\\"text-align: right;\\\">.شبّهَ الكاتبُ قريتَهُ بمدينةِ الخوفِ والرّعبِ</p>\\n\",\"<p style=\\\"text-align: right;\\\">.شبّهَ الكاتبُ قريتَهُ بمدينةٍ هادئةٍ ومملّةٍ</p>\\n\"]},{\"subContentId\":\"fccd590a-5679-496f-9374-adfaaf8b98ed\",\"question\":\"<p style=\\\"text-align:right\\\">ج- ماذا يقصدُ الكاتبُ بعبارةِ \\\"وَلا يُفارِقُ آذارٌ خَمائِلَها\\\"؟</p>\\n\",\"answers\":[\"<p style=\\\"text-align: right;\\\">.أيْ أنَّ شهرَ آذارَ وهوَ أحدُ أشهر الرّبيعِ تظهرُ فيهِ روعةُ الأشجارِ الكثيفةِ الملتفّةِ</p>\\n\",\"<p style=\\\"text-align: right;\\\">.أيْ أنَ شهرَ آذارَ يذبلُ تلكَ الأشجارِ</p>\\n\",\"<p style=\\\"text-align: right;\\\">.أيْ أنَّ شهرَ آذارَ وهوَ أحدُ الأشهرِ الّتي تتساقطُ فيهِ الأوراقُ الصّفراءُ</p>\\n\"]},{\"subContentId\":\"2e1183de-9602-48ae-8739-27498f1345b1\",\"question\":\"<p style=\\\"text-align:right\\\">د- ما هوَ تأثيرُ الغيمِ ولماذا يسرعُ مشتاقًا ليلاً ليلثمَ القريةَ؟</p>\\n\",\"answers\":[\"<p style=\\\"text-align: right;\\\">&nbsp;.الغيمُ يحجبُ الضّوءَ الشّمسيَّ عنِ القريةِ</p>\\n\",\"<p style=\\\"text-align: right;\\\">.الغيمُ يضفي جمالًا وسحرًا إضافيًا على القريةِ</p>\\n\",\"<p style=\\\"text-align: right;\\\">.الغيمُ&nbsp;يجلبُ الخطرَ والتّهديدَ للقريةِ</p>\\n\"]},{\"subContentId\":\"5ee827d1-c914-49b6-80d8-394c0f203fd7\",\"question\":\"<p style=\\\"text-align:right\\\">ه- منْ يطلُّ منَ الشّبابيكِ الخضراءِ؟</p>\\n\",\"answers\":[\"<p style=\\\"text-align: right;\\\">.وجوهُ الأحبّاءِ والخلّانِ منْ سكّانِ القريةِ</p>\\n\",\"<p style=\\\"text-align: right;\\\">.الأزهارُ هيَ الّتي تطلُّ منَ الشّبابيكِ</p>\\n\",\"<p style=\\\"text-align: right;\\\">.الطيورُ والحيواناتُ في القريةِ هيَ الّتي تطلُّ منَ الشّبابيكِ الخضراءِ</p>\\n\"]},{\"subContentId\":\"c601bffb-a8de-4b59-bb45-9206f4bf7084\",\"question\":\"<p style=\\\"text-align:right\\\">و- منِ الّذي بنى صروحَ تلكَ القريةِ؟</p>\\n\",\"answers\":[\"<p style=\\\"text-align: right;\\\">.أهلُ الكاتبِ وأبناءُ القريةِ همْ منْ بنوا صروحَ القريةِ</p>\\n\",\"<p style=\\\"text-align: right;\\\">.أشخاصٌ منْ خارجِ القريةِ همْ منْ بنوا تلكَ الصّروحِ</p>\\n\",\"<p style=\\\"text-align: right;\\\">.أصدقاءُ الكاتبِ المهاجرونَ همْ منْ ساهموا وبنوا تلكَ الصّروحِ</p>\\n\"]},{\"subContentId\":\"43db12ce-ef7a-44f1-b790-5e5e6cde3ff3\",\"question\":\"<p style=\\\"text-align:right\\\">ز- هلْ نسيَ الكاتبُ قريّتّهُ يومًا؟</p>\\n\",\"answers\":[\"<p style=\\\"text-align: right;\\\">.كلّا، بلْ تبقى صورةُ القريةِ في مخيّلةِ ووجدانِ الكاتبِ دومًا</p>\\n\",\"<p style=\\\"text-align: right;\\\">.نعم، لطالما نسيَ الكاتبُ قريتهُ وانشغلَ بحياتِهِ اليوميّةِ</p>\\n\"]}],\"overallFeedback\":[{\"from\":0,\"to\":100}],\"behaviour\":{\"autoContinue\":true,\"timeoutCorrect\":2000,\"timeoutWrong\":3000,\"soundEffectsEnabled\":true,\"enableRetry\":true,\"enableSolutionsButton\":true,\"passPercentage\":100},\"l10n\":{\"nextButtonLabel\":\"Next question\",\"showSolutionButtonLabel\":\"أظهر الحلّ\",\"retryButtonLabel\":\"أعد المحاولة\",\"solutionViewTitle\":\"قائمةُ الحلول\",\"correctText\":\"
